import React from 'react';
import '../App.css';
import { Flex, Box } from 'rebass'

const gameStyle = {
  align: 'center',
}

const dealerStyle = {
  height: '250px',
  width: '50%',
  background: 'blue'
}

const BlackjackGame = () => {
  return (
    <Flex>
      <Box style={dealerStyle}>
        Dealer
      </Box>
      <div class='player'>
        Player
        <button>HIT</button>
        <button>STAY</button>
        <button>PLAY AGAIN</button>
      </div>
      <div class='ai'>
        AI
      </div>
    </Flex>
)
}

export default BlackjackGame;
